import React from 'react'
import Layout from '../components/Layout'
const Index: React.FunctionComponent = (props) => {
  return (
    <Layout title="Home">
      <div>
        welcome {props.message}
      </div>
    </Layout>
  )
}

export async function getStaticProps(context){
  return{
    props:{
      message: `next.js!`
    }
  };
}
export default Index;
